intro:
* VNBET99 - Nhà cái lớn nhất Việt Nam
Cá cược Bong88 - đá gà - xóc đĩa - tài xỉu Click đăng ký ngay!

Tìm bạn some, vợ chồng mình yêu cầu như sau:
1. Tuổi: từ 18 đến 33 tuổi;
2. Ngoại hình: dễ nhìn, cao từ 1m65, nặng từ 60kg, ưu tiên đẹp trai, hàng từ 15cm; sạch sẽ, thơm tho (bà xã hơi khó tính)
3. Công việc: ổn định, rõ ràng
4. Tài chính: không liên quan tài chính;
5. Bảo mật: tuyệt đối bảo mật thông tin;
6. Khu vực: gò vấp, thủ đức, bình thạnh,...
